y shortened to just </tspan><tspan x="0" y="16.2" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">night heron in Eurasia, is a medium-sized heron found throughout a large part of </tspan><tspan x="0" y="32.4" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">the world, except in the coldest regions and Australasia (where it is replaced by </tspan><tspan x="0" y="48.6" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">the closely related rufous night heron, with which it has hybridized in the area of </tspan><tspan x="0" y="64.8" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">contact).</tspan></text>	</g>	<rect x="37.4" y="55" display="inline" fill="none" width="458.9" height="37"/>			<text id="name" transform="matrix(1 0 0 1 70.0774 77.8237)" display="inline" fill="#603813" font-family="'TwCenMT-Regular'" font-size="36px">Black-crowned Night-Heron</text>	<rect x="119.7" y="545" display="inline" fill="none" width="294.3" height="28"/>			<text id="scientificName" transform="matrix(1 0 0 1 161.9485 562.0371)" display="inline" fill="#603813" font-family="'Parisienne-Regular'" font-size="26px">Nycticorax nycticorax</text></g><g id="Descriptions" display="none">			<text id="graphName" transform="matrix(1 0 0 1 539.22 146.9308)" display="inline" fill="#603813" font-family="'TwCenMT-Bold'" font-size="26px">{{   chosenItemInfo[chosenItem].text   }}</text>	<g id="SpeciesNumberDescription" onload="v-show=chosenItem=='SpeciesNumber'" display="inline">		<rect x="654.6" y="578" fill="none" width="291.9" height="49.8"/>		<text transform="matrix(1 0 0 1 654.5771 585.6074)"><tspan x="0" y="0" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="12px">The sum of all observed individuals for the selected query </tspan><tspan x="0" y="12" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="12px">region and species. This is computed as the sum of the </tspan><tspan x="0" y="24" fill="#42210B" f
